css:
.editor-colors {
  background-color: #1c1101;
  color: #ae926a;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #3a2a13;
}
.editor .gutter {
  background-color: #2a1a03;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #d33682;
}
.editor .cursor {
  border-color: #fdf6e3;
}
.editor .selection .region {
  background-color: #332510;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #3a2a13;
}
.bracket-matcher {
  background-color: #93a1a1;
  opacity: 0.7;
}
.comment {
  color: #61461f;
  font-style: italic;
}
.entity {
  color: #b58900;
}
.keyword {
  color: #8c7048;
}
.storage.type {
  color: #8c7048;
}
.constant {
  color: #b58900;
}
.constant.numeric,
.constant.boolean {
  color: #2aa198;
}
.variable {
  color: #4288ba;
}
.delimiter,
.brace {
  color: #b62f2f;
}
.delimiter.period {
  color: #8c7048;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #b62f2f;
}
.invalid.illegal {
  color: #b62f2f;
}
.string {
  color: #2aa198;
}
.string .constant.character.escape {
  color: #b62f2f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #b62f2f;
}
